import React from 'react';

function Rfp() {
	return (
		<div className='w-full bg-yellow-100'>
			<div className='container mx-auto flex justify-between p-5'>

				<div >
					<div className='bg-white rounded-lg shadow-lg '>
						<h1 className='text-4xl font-medium px-[200px] py-[50px] text-center'>Request For Proposal</h1>
					</div>
					<h1 className='text-3xl font-medium px-[200px] py-[50px] text-center '>PROJECT INFO</h1>
			

				</div>
				

				<div>rfp</div>



			</div>
		</div>


	);
}

export default Rfp;
